INSERT INTO public.practices VALUES (2, 'AI Prompt Engineering ve společnosti GOOD at IT s.r.o', 'Zajímá tě, jak efektivně komunikovat s velkými jazykovými modely jako je GPT-4? Chceš se naučit tvořit prompty, které vedou ke spolehlivým, přesným a kreativním výstupům?

Během stáže v týmu GOOD at IT s.r.o se zapojíš do vývoje a testování AI řešení využívajících jazykové modely (LLMs). Naučíš se navrhovat, strukturovat a optimalizovat textové instrukce – tzv. prompty – pro různé use-casy: od generování obsahu, přes automatizaci procesů až po vytváření nástrojů pro zákazníky.', 'Navrhovat, testovat a ladit textové prompty pro různé aplikace (chatboti, obsah, klasifikace, generování kódu, apod.)
Vyhodnocovat kvalitu výstupů modelu podle zadaných metrik (např. relevance, přesnost, tón, konzistence)
Vytvářet A/B testy různých verzí promptů a analyzovat výsledky
Spolupracovat s vývojáři a datovými analytiky na integraci promptů do interních nebo klientských nástrojů
Přispívat k budování interní knihovny „osvědčených promptů“ pro různé domény (marketing, technická podpora, produktivita…)', 2, '2025-10-01', '2025-10-29', true, 'data:image/png;base64,', 3, 0, 0, 1, 5, '2025-07-30 05:52:14.077624+00', '2025-07-30 05:52:14.077647+00', 1);
INSERT INTO public.practices VALUES (1, 'Frontend/Backend Developer ve společnosti GOOD at IT s.r.o', 'Co tě u nás čeká?
Zapojíš se do vývoje interních i klientských webových aplikací
Budeš psát kód v JavaScriptu (React, Node.js) nebo Pythonu (Flask/Django) – podle tvé specializace
Naučíš se pracovat s databázemi (PostgreSQL, MongoDB)
Získáš přehled o Git, Dockeru a CI/CD
Budeš součástí agilního týmu – denní stand-upy, retrospektivy, code reviews
Zkušený mentor ti bude po ruce od prvního dne

Koho hledáme?
Základní znalost programování (např. ve škole, na kurzech nebo vlastních projektech)
Chuť učit se novým věcem a aktivně se zapojit
Znalost angličtiny alespoň na technické úrovni', 'Podílet se na vývoji a údržbě webových aplikací ve spolupráci s týmem vývojářů
Programovat jednoduché komponenty na frontendu (React) nebo endpointy na backendu (Node.js / Python)
Navrhovat a upravovat databázové struktury (PostgreSQL, MongoDB)
Testovat nové funkce a opravovat nalezené chyby
Dodržovat verzování a workflow pomocí Git (GitLab nebo GitHub)', 5, '2025-09-01', '2025-09-26', true, 'data:image/png;base64,', 3, 0, 0, 1, 3, '2025-07-30 05:38:54.865385+00', '2025-07-30 05:53:03.307628+00', 1);


